容量：2000ml<BR>
★使用方法★<BR>
使用する場所全体を水でぬらしてください。<BR>
普通は3倍で汚れが強い場合は２倍にして水と一緒に薄めてください。<BR>
はけや布に浸して塗布して下さい。<BR>
２～３分後、汚れが落ちたら乾く前に水をかけて洗い流して下さい。<BR>
